import logo from '../../images/website-logo.png';

const NoMatch = () => {

    return (
        <div className="bg-white text-center mt-5 text-danger">
            <div>
                <img src={logo} height="70" className="img-fluid" alt="website logo"/>
                <span className="text-white">Sports World</span>
            </div>
            <h1>404</h1>
            <h5 className="text-uppercase mt-4">page not found</h5>
        </div>
    );
};

export default NoMatch;
